create table venda(
  codigo bigint not null,
  codigo_produto bigint not null,
  codigo_produto_exibicao bigint not null,  
  descricao_produto varchar(90) not null,
  medida varchar(10) default null,
  valor_unitario decimal(12, 2) not null,
  quantidade decimal(10, 2) not null,
  desconto decimal(12, 2) default 0.00 not null,
  data_hora_venda timestamp not null,
  md5 varchar(32) not null,
  registro_emitente bigint not null
);

create table configuracao(
  nfce_token_csc varchar(50) default null,
  nfce_token_id varchar(20) default null,
  nfce_serie bigint default null,
  nfce_numero_emitido bigint default null,
  nfce_ambiente_emissao integer default null,
  api_conexao_token varchar(50) default null,
  certificado_serie varchar(50) default null,
  certificado_senha varchar(50) default null,
  registro_emitente bigint not null
);

