--
-- AUTO_INCREMENT de tabela `cliente`
--
create generator gen_cliente_codigo;

set term ^;
create or alter trigger cliente_bi0 for cliente
active before insert position 0
as
begin
   /* GERAR NOVO ID */
  if ((new.codigo_cliente is null) or (new.codigo_cliente <= 0)) then
    new.codigo_cliente = gen_id(gen_cliente_codigo, 1);
end
^
set term; ^
